# Balandro - Menú por Géneros
# ------------------------------------------------------------

from platformcode import config, logger, platformtools
from core.item import Item

from core import channeltools
import base64

all_genres_64 = ''
all_genres = eval(base64.b64decode(all_genres_64))


def mainlist(item):
    logger.info()
    itemlist = []
    item.category = 'Géneros en canales'
    
    for genero in sorted(all_genres.keys()):
        itemlist.append(item.clone( action='genero', genero=genero, title=genero ))
    
    return itemlist


def genero(item):
    logger.info()
    itemlist = []
    item.category = item.genero

    for enlace in sorted(all_genres[item.genero], key=lambda it: (it['search_type'], it['channel'], it['title'])):

        ch = channeltools.get_channel_parameters(enlace['channel'])
        if not ch['active']: continue
        if ch['status'] == -1: continue
        
        if enlace['search_type'] == 'movie':
            txt = 'Películas'
            color = 'deepskyblue'
        else:
            txt = 'Series'
            color = 'hotpink'
        
        titulo = '%s - [COLOR %s]%s[/COLOR] - %s' % (ch['name'], color, txt, enlace['title'])
        
        it = Item( channel=ch['id'], title=titulo, thumbnail=ch['thumbnail'], category= item.genero + ' @ ' + ch['name'] )
        for x in enlace:
            if x not in ['channel', 'title']: it.__dict__[x] = enlace[x]

        itemlist.append(it)

    return itemlist
